                <Nav.Item><Nav.Link eventKey="INT" onSelect={this.onSelectFilterAttribute}>INT</Nav.Link></Nav.Item>
                </Nav>
            </Navbar>
            <ul>
                {
                this.props.list.map( hero => {
                return <li>{hero.name}  : {hero.role}</li>})
                }
            </ul>
            </>
        );
    }
  }
